import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const CardPais = ({ flag, name, continent, id }, props) => {
  return (
    <CardContainer>
      <CardRender>
        <div>
          <Link to={`/country/${id}`}>
            <img src={flag} alt="flag" />
          </Link>
        </div>
        <section>
          <h1>{name}</h1>
          <h2>{continent}</h2>
        </section>
      </CardRender>
    </CardContainer>
  );
};

export default CardPais;

const CardContainer = styled.main``;

const CardRender = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  align-items: center;
  justify-items: center;
  section {
    height: 16rem;
    width: 16rem;
    display: flex;
    flex-direction: column;
    justify-content: space-evenly;
    text-align: center;
    background: rgba(255, 255, 255, 0.1);
    backdrop-filter: blur(10px);
    color: #131516;
    border-radius: 2rem;
    box-shadow: 0 0 16px 0px rgba(0, 0, 0, 0.5);
    text-shadow: 4px 1px 6px rgba(0,0,0,0.6);
  }
  div img {
    width: 20rem;
    height: 20rem;
    object-fit: cover;
    border-radius: 1rem;
    box-shadow: 16px 17px 24px -6px rgba(0, 0, 0, 0.84);
    -webkit-box-shadow: 16px 17px 24px -6px rgba(0, 0, 0, 0.84);
    -moz-box-shadow: 16px 17px 24px -6px rgba(0, 0, 0, 0.84);
  }
`;
